import React from 'react';
import CreateTask from './CreateTask';
import TaskList from './TasksList';

class Home extends React.Component {
    render() {
        return (
            <div className="container-fluid pt-4">
                <div className="row">
                    <div className="col-md-6">
                        <CreateTask />
                    </div>
                    <div className="col-md-6">
                        <TaskList />
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
